import React from "react";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { createStackNavigator } from '@react-navigation/stack';
import HomeScreen from "../screens/HomeScreen";
import SettingScreen from "../screens/SettingScreen";
import SeguridadScreen from "../screens/SeguridadScreen";
import Splash from "../screens/Splash";

const Drawer = createDrawerNavigator()
const Stack = createStackNavigator(); // Importa el StackNavigator

export function DrawerNavigation(){
    return(
        <Stack.Navigator headerMode="none">
        <Stack.Screen name="Splash" component={Splash} />
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="Register" component={Register} />
            <Drawer.Navigator>
                <Drawer.Screen name="Inicio" component={HomeScreen}/>
                <Drawer.Screen name="Mi Perfil" component={Profi}/>
                <Drawer.Screen name="Publicar" component={SettingScreen}/>
                <Drawer.Screen name="Notificaciones" component={SettingScreen}/>
                <Drawer.Screen name="Sobre Nosotros" component={SettingScreen}/>
                <Drawer.Screen name="Configuracion">
                {() => (
                    <Stack.Navigator>
                    <Stack.Screen name="Configuracion" component={SettingScreen} />
                    <Stack.Screen name="Seguridad" component={SeguridadScreen} />
                </Stack.Navigator>
                )}
                </Drawer.Screen>
            </Drawer.Navigator>
        </Stack.Navigator>
    )
}
